●商品サイズ（約）：幅105×奥行75×高さ240mm。●重量（約）：990g。●成分：ナフタリン等。●非農耕地用。もぐら、へびの侵入防止に。●使い方：【もぐらに対して】(1)もぐらが侵入してほしくない所の周囲に、約30～60cm間隔で直径約5cm、深さ15～30cmの穴を掘ります。(2)1穴につき約20g（コップ約1/4）を入れてその上に土を戻します。(3)既にもぐらが侵入していると効果がない場合があるので、地面を足踏みしてモグラを驚かせ、追い出してから使用するのをお勧めします。【へびに対して】。 ●もぐら、へびの嫌がるニオイで警戒心を与え、庭などへの侵入を防ぎます。●ニオイによる忌避のため、死がいを処理する必要がありません。●ヘビの侵入を防ぎたい所に約10～30cm幅の帯状に、本剤を地面にまく。●その周辺にも散布するとより効果的。●約1ヶ月持続します。 ●本品は非農耕地用で屋外専用です。農作物が栽培されている区画内では使用しないでください。その周辺で使用する場合は、農作物から50cm以上話して使用してください。●自動車や塗装したもの、金属、プラスチックは損傷する場合があるので使わないこと。●効果やその期間は個体や使用状況によって変わります<style type="text/css">
